          2nd menu item
        </Menu.Item>
        <Menu.Item key="3" icon={<UserOutlined />}>
          3rd menu item
        </Menu.Item> */}
    </Menu>
  );



  return (
    <Space wrap>
      <Dropdown.Button
        onClick={handleButtonClick}
        overlay={menu !== undefined && menu}
      >
        {DropDownText}
      </Dropdown.Button>
    </Space>
  );
};

export default DropDown;
